import React, { useEffect, useState } from 'react'
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'
import NavBar from './components/navbar/navbar'
import 'bootstrap/dist/css/bootstrap.min.css';
import Auctions from './components/auctions/auctions';
import Home from './components/home/home';
import Auction from './components/auctions/auction/auction';

// const searchedList = ["tooth paste","tooth brush","mouth wash","dental floss","mouth guard"]
const App = () => {
    // State of auctions
    const [auctions, setAuctions] = useState([])

    useEffect(() => {
        // // Get all articles
        // fetch('http://localhost:8080/articles')
        // .then(response => {
        //     if (response.ok) {
        //         return response.json();
        //     }
        // }).then( data => {
        //     console.log(data.data);
        //     setArticles(data.data);
        // })
        // Get all auctions
        fetch('http://localhost:8080/auctions')
        .then(response => {
            if (response.ok) {
                return response.json();
            }
        }).then(data => {
            setAuctions(data.data)
        })
    }, [])

    return (
        <div className="container-fluid">
            <NavBar/>
            <Router>
                <div>
                    <Switch>
                        <Route exact path="/">
                            <Home/>
                        </Route>
                        <Route exact path="/home">
                            <Home/>
                        </Route>
                        <Route exact path="/auctions" component={Auctions}>
                        </Route>
                        <Route path="/auctions/articles/:id" component={Auction}></Route>
                    </Switch>
                </div>
            </Router>
        </div>
    )
}

export default App
